import { memo, useState, useEffect } from 'react';
import { Dialog } from 'primereact/dialog';
import { DataTable } from 'primereact/datatable';
import { Column } from 'primereact/column';
import { Button } from 'primereact/button';
import { RadioButton } from "primereact/radiobutton";
import { InputNumber } from 'primereact/inputnumber';
import { InputTextarea } from 'primereact/inputtextarea';

function ShowDialog( props ) {
 const { selectedProducts, setSelectedProducts, dialogVisible, description, handeOpenBillAll, staff, handleChangeSelect, handleChangeRadio, ingredient, dialogFooterTemplate, handeCloseBillAll, handleChangeDescription } = props;
 const [total, setTotal] = useState(0);
 
  useEffect(() => {
    selectedProducts && selectedProducts.length >0  ?
    setTotal(selectedProducts.reduce((sum, current) => sum + Number(current.Quantity), 0)) : setTotal(0)
 }, [selectedProducts])

 const onRowEditComplete = (e) => {
  let _products = [...selectedProducts];
  let { newData, index } = e;
  _products[index] = newData;
  setSelectedProducts(_products);
 };
 
 const priceEditor = (options) => {
  return <InputNumber value={options.value} style={styles.inputNumber} onValueChange={(e) => options.editorCallback(e.value)} />;
 };
    return (
     <>
     <Button style={styles.margin_top} label="Lấy nhiều đơn hàng" icon="pi pi-external-link" onClick={ () => handeOpenBillAll()} />
     <Dialog style={styles.text} header="Đơn hàng đã chọn" visible={dialogVisible} maximizable
                   modal contentStyle={{ height: '300px' }} onHide={() => handeCloseBillAll()} footer={dialogFooterTemplate}>
        <select className="form-select" style={styles.margin_top} onChange ={ handleChangeSelect }>
           <option value="">Chọn nhân viên giao hàng</option>
           { staff && staff.length>0  ? 
              staff.map((item, index) => { return ( <option key={index} value={item.CODE}>{item.CODE} - {item.NAME}</option>) }) : "" }
        </select>
        <div className="flex align-items-center" style={styles.radio}>
          <RadioButton inputId="ingredient1" name="pizza" value="1" onChange={ handleChangeRadio } checked={ingredient === '1'} />
            <label style={styles.label} htmlFor="ingredient1" className="ml-2">Xe máy</label>
           <RadioButton inputId="ingredient2" name="pizza" value="2" onChange={ handleChangeRadio } checked={ingredient === '2'} />
            <label style={styles.label} htmlFor="ingredient2" className="ml-2">Xe ô tô</label>
        </div>
        <label style={styles.text} htmlFor="description">Ghi chú</label>
        <InputTextarea style={styles.text} rows={2} cols={30} value ={ description } onChange = { handleChangeDescription }/>
        <span style={styles.spanE}> Tổng số kiện: { total  }</span>
        <DataTable value={selectedProducts} editMode="row" scrollable scrollHeight="flex" style={styles.dataTable} onRowEditComplete={onRowEditComplete}>
          <Column field="Number" header="Số hóa đơn" style={{ width: '15%' }}></Column>
          <Column field="CustomerName" header="Tên khách hàng" style={{ width: '60%' }}></Column>
          <Column field="Quantity" header="Số kiện" editor={(options) => priceEditor(options)} style={{ width: '20%' }}></Column>
          <Column header="Thao tác" rowEditor headerStyle={{ width: '5%', minWidth: '8rem' }} bodyStyle={{ textAlign: 'center' }}></Column>
        </DataTable>
     </Dialog>
     </>
    )
}

export default memo(ShowDialog);

const styles = {
 margin_top:{
     marginTop:"10px",
     fontFamily:"Times New Roman"
 },
 dataTable:{
     fontFamily:"Times New Roman"
 },
    text : {
      fontFamily:"Times New Roman",
      fontWeight: 500
    },
    radio : {
      fontFamily:"Times New Roman",
      fontWeight: 500,
      margin:"15px 0px 30px"
    },
    label : {
      margin:"0px 10px 0px"
    } ,
    spanE : {
      fontFamily:"Times New Roman",
      fontWeight: 900,
      color: "#008080"
    },
    inputNumber:{
      width: "50px"
    }

}
